import React, { useState, useEffect } from 'react'

const Home = () => {
    useEffect(() => {
        getPopulateMovies();
    }); 

    const [ popularMovies, setPopularMovies ] = useState([]);
    const getPopulateMovies = async () => {
        const response = await fetch('https://api.themoviedb.org/3/movie/popular?api_key=5bcd76c471e358e143b8721211e000d4')
        const allPopularMovies : string[] = await response.json;

        console.log(allPopularMovies);
        setPopularMovies(allPopularMovies);
    }

    return (
        <div>
            <div>search bar</div>
            <div>listing items</div>
        </div>
    )
}

export default Home
